import './App.css';
import Form from './componets/Form';
import Header from './componets/Header';
const App=() =>{
  return (
  <div className='container'>
    <div className='app-wrapper'>
      <div>
        <Header/>
      </div>
      <div>
      <Form/>
    </div>

    </div>
  </div>
  );
}

export default App;
